import{_ as e,c as a,o as i,a as t}from"./app.6426b36b.js";const u=JSON.parse('{"title":"Obsidian同步","description":"","frontmatter":{"title":"Obsidian同步","date":"2022-07-27T22:42:12.000Z","tags":["Obsidian同步"]},"headers":[{"level":2,"title":"配置一些快捷键","slug":"配置一些快捷键","link":"#配置一些快捷键","children":[{"level":3,"title":"配置git","slug":"配置git","link":"#配置git","children":[]},{"level":3,"title":"配置文章输入模板","slug":"配置文章输入模板","link":"#配置文章输入模板","children":[]},{"level":3,"title":"配置日记","slug":"配置日记","link":"#配置日记","children":[]},{"level":3,"title":"配置图床","slug":"配置图床","link":"#配置图床","children":[]},{"level":3,"title":"安装表格插件 Advanced Tables","slug":"安装表格插件-advanced-tables","link":"#安装表格插件-advanced-tables","children":[]},{"level":3,"title":"安装vim插件 vimrc Support","slug":"安装vim插件-vimrc-support","link":"#安装vim插件-vimrc-support","children":[]},{"level":3,"title":"切换达到vscode的快捷键command + p","slug":"切换达到vscode的快捷键command-p","link":"#切换达到vscode的快捷键command-p","children":[]}]},{"level":2,"title":"Ipad","slug":"ipad","link":"#ipad","children":[{"level":3,"title":"参考链接","slug":"参考链接","link":"#参考链接","children":[]}]}],"relativePath":"工作区/开发工具/Obsidian同步.md"}'),d={name:"工作区/开发工具/Obsidian同步.md"},n=t(`<p>#Obsidian</p><h1 id="obsidian同步的笔记" tabindex="-1">Obsidian同步的笔记 <a class="header-anchor" href="#obsidian同步的笔记" aria-hidden="true">#</a></h1><blockquote><p>同步于ipad与 Mac</p></blockquote><p>安装 Obsidian git插件</p><blockquote><p>完成同步以及一些插件的使用配置</p></blockquote><h2 id="配置一些快捷键" tabindex="-1">配置一些快捷键 <a class="header-anchor" href="#配置一些快捷键" aria-hidden="true">#</a></h2><h3 id="配置git" tabindex="-1">配置git <a class="header-anchor" href="#配置git" aria-hidden="true">#</a></h3><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281002509.png" alt=""></p><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281002470.png" alt=""></p><blockquote><p>后面个人工作流加入了Manico 所以<code>option</code>键经常用到，把git的快捷键改成了<code>control</code>键</p></blockquote><h3 id="配置文章输入模板" tabindex="-1">配置文章输入模板 <a class="header-anchor" href="#配置文章输入模板" aria-hidden="true">#</a></h3><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281004723.png" alt=""></p><p>配置快捷键使用</p><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202212201723495.png" alt=""></p><h3 id="配置日记" tabindex="-1">配置日记 <a class="header-anchor" href="#配置日记" aria-hidden="true">#</a></h3><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281005601.png" alt=""></p><h3 id="配置图床" tabindex="-1">配置图床 <a class="header-anchor" href="#配置图床" aria-hidden="true">#</a></h3><p>picGo启动后会有个本地的服务器，安装picGo插件即可，默认配的就是那个端口号<strong>36677</strong><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281007075.png" alt=""></p><h3 id="安装表格插件-advanced-tables" tabindex="-1">安装表格插件 Advanced Tables <a class="header-anchor" href="#安装表格插件-advanced-tables" aria-hidden="true">#</a></h3><table><thead><tr><th>安装</th><th>即可</th></tr></thead><tbody><tr><td>能用</td><td>就行</td></tr></tbody></table><h3 id="安装vim插件-vimrc-support" tabindex="-1">安装vim插件 vimrc Support <a class="header-anchor" href="#安装vim插件-vimrc-support" aria-hidden="true">#</a></h3><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202207281013002.png" alt=""></p><h3 id="切换达到vscode的快捷键command-p" tabindex="-1">切换达到vscode的快捷键<code>command + p</code> <a class="header-anchor" href="#切换达到vscode的快捷键command-p" aria-hidden="true">#</a></h3><blockquote><p>将原来的<code>comand + p</code> 改为其他的 比如 <code>command + o</code></p></blockquote><p><img src="https://raw.githubusercontent.com/Hbisedm/my-blob-picGo/main/img/202212201709424.png" alt=""></p><h2 id="ipad" tabindex="-1">Ipad <a class="header-anchor" href="#ipad" aria-hidden="true">#</a></h2><blockquote><p>安装<code>ISH Shell</code></p></blockquote><p>app Store安装ISH</p><p>使用apk安装git</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki"><code><span class="line"><span style="color:#A6ACCD;">apk add git</span></span>
<span class="line"></span></code></pre></div><p>git 一直卡住，一直拉不了远程仓库</p><p>ish里面可以使用mount 挂载命令 去指定挂载ipad的目录</p><p>后面在ipad安装working Copy，使用它去拉取远程仓库，但是吧这个东西copy到指定目录出来的东西是zip压缩包。。。</p><p>然后通过ish解压这个压缩包</p><p>这样就可以达到同步远程仓库的文件了。</p><p>但是这样真的太麻烦了。</p><p>后续找其他方法取代一下。</p><p>目前使用vitePress 部署整个obsidian 方便看</p><h3 id="参考链接" tabindex="-1">参考链接 <a class="header-anchor" href="#参考链接" aria-hidden="true">#</a></h3><ul><li><a href="https://zhuanlan.zhihu.com/p/133748589" target="_blank" rel="noreferrer">&#39;iSH，你的IOS设备移动开发终端使用教程1（在iPad上安装Linux） - 知乎&#39;</a></li><li><a href="https://gist.github.com/DannyQuah/f686c0e43b741468e12515cd79017489" target="_blank" rel="noreferrer">同步</a></li></ul>`,40),c=[n];function o(r,s,l,p,h,m){return i(),a("div",null,c)}const g=e(d,[["render",o]]);export{u as __pageData,g as default};
